import { Button, StyleSheet, Text, View } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import AuthLogin from "./components/admin/AuthLogin";
import Rooms from "./components/admin/Rooms";
import Client from "./components/Client";

const Stack = createNativeStackNavigator();

const Welcome = ({ navigation }) => {
	return (
		<View style={{ justifyContent: "center", alignItems: "center" }}>
			<Text>Choose a Room</Text>
			<Button
				title="Room 1"
				onPress={() => {
					navigation.navigate("/room", { room: 1 });
				}}
			/>
		</View>
	);
};

export default function App() {
	return (
		<NavigationContainer>
			<Stack.Navigator>
				<Stack.Screen name="/" component={Welcome} options={{ title: "Welcome" }} />
				<Stack.Screen name="/room" component={Client} options={({ route }) => ({ title: route.params.name })} />
				<Stack.Screen name="/admin" component={Rooms} options={{ title: "Rooms Admin" }} />
				<Stack.Screen name="/login" component={AuthLogin} />
			</Stack.Navigator>
		</NavigationContainer>
	);
}

const styles = StyleSheet.create({
	container: {
		flex: 1,
		backgroundColor: "#fff",
		alignItems: "center",
		justifyContent: "center",
	},
});
